import React, {Component} from 'react';
import './App.css';
import Navigation from '../components/Navigation/Navigation'


class App extends Component {

  constructor(){
    super();
    this.state={
      input: '',
      imgUrl: '',
      box: '',
      route: 'signin',
      isSignedIn: false,
      user:{
        id: '',
        name: '',
        email: '',
        entries: 0,
        joined: ''
      }
    }
  }

  render(){
    return (
      <div >
        <Navigation />             
      </div>
    )
  }
}

export default App;
